  false,\n\t\"url\": null,\n\t\"notes\": \"The San Francisco Bay Area is one of 34
  Waterfowl Habitat Areas of Major  Concern (#27) in Canada and the United States
  identified in the North  American Waterfowl Management Plan. The study area for
  this project is  defined as the immediate watershed for San Francisco and San Pablo
  Bays  as shown in Figure 1. The study area has been further subdivided into north
  and south units and a Bay Zone which rings the Bay. The San Francisco-Oakland Bay
  Bridge divides the north and south units (Figure 2). The Suisun Bay and Sacramento-San
  Joaquin Delta are not included in this study but are a part of the Central Valley
  (Sacramento and San Joaquin River Watershed) Habitat Area of Major Concern (#26).
  The Central Valley of California is one of the top priority areas for waterfowl
  habitat protection under the North American Plan. A Central Valley Waterfowl Habitat
  Joint Venture is currently being implemented. The California Coast north of San
  Francisco Bay is included in the Middle and Upper Pacific Coast Habitat Area of
  Major Concern (#29). This report presents objectives for maintaining and enhancing
  those wetlands currently protected (see Table 6) and sets forth the objectives for
  protecting and restoring additional wetland areas (see Table 8). Achievement of
  these objectives is necessary if the broader goals of the North American Plan are
  to be met.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
